  const handleClick = () => {
    navigate('/roles')
  }

  return (
    <div className='login'>
        <Restaurant/>
        <img className='ilustration' src={ilustration} alt="i;"></img>
        <h2>Login</h2>
        <h3> Name </h3>
        <input type="text"/>
        <h3> Password </h3>
        <input type="password"/>
        <button className='input-login' onClick={handleClick}> Sign In  </button>
    </div>
  )
}

export default Login;
